<script setup>
import { onMounted, onUnmounted, ref } from 'vue'
// import useCanvas from './canvasUse/useCanvas'
// import useSvg from './svgUse/useSvg'

const props = defineProps({
  pasien: {
    type: Object,
    default: null
  },
  height: {
    type: Number,
    default: 300
  },
  workspace: {
    type: Object,
    default: null
  }
})

const refSvg = ref(null)
// defineExpose({ refSvg })

// eslint-disable-next-line no-unused-vars
// const { _initSVG, targetEl, masters } = useSvg(props.pasien)

onMounted(() => {
  _initSVG(refSvg.value)
})

// eslint-disable-next-line no-unused-vars
const _initSVG = (_svg) => {
  const gSvg = _svg.children
  for (let i = 0; i < gSvg?.length; i++) {
    const group = gSvg[i]?.children
    // console.log('el', group)
    for (let x = 0; x < group?.length; x++) {
      const path = group[x]
      // console.log('path', path)
      path.classList.add('main')
      path.addEventListener('mouseover', onMouseOver)
      path.addEventListener('mouseleave', onMouseLeave)
    }
    // path.addEventListener('mouseover', onMouseOver)
  }
  // el.style.pointerEvents = 'auto'
}

// eslint-disable-next-line no-unused-vars
const checkChildren = (el) => {
  const g = document.getElementById('HierarchicalLayers')?.children
  // const hierarchiEl = []
  for (let i = 0; i < g?.length; i++) {
    const g1 = g[i]
    // console.log('g1', g1)

    for (let x = 0; x < g1.children?.length; x++) {
      const g2 = g1.children[x] // ini group nama
      // console.log('g2', g2.children)
      // if (g2.childElementCount > 0) {
      for (let n = 0; n < g2.children?.length; n++) {
        const el = g2.children[n]
        el.setAttribute('pointer-events', 'bounding-box')
        el.addEventListener('mouseover', onMouseOver)
      }
      // }
    }
  }

  // console.log('hierarcy', hierarchiEl)
}

// eslint-disable-next-line no-unused-vars
function onMouseOver(e) {
  e.preventDefault()
  e.stopPropagation()
  // console.log('el mouseover')
  // const targetId = document.getElementById(e)
  // console.log('targetId', e?.target)

  if (e?.target) {
    e.target.style.opacity = 1
    // targetId.style.fill = 'rgba(71, 71, 71, 0.8)'
    // targetId.style.stroke = 'rgba(71, 71, 71, 1)'
    e.target.style.strokeWidth = 1
  }

}
function onMouseLeave(e) {
  // e.stopPropagation()
  // console.log('el mouseleave', targetId)
  if (e?.target) {
    e.target.style.opacity = 0
    // targetId.style.fill = 'rgba(71, 71, 71, 0.8)'
    // targetId.style.stroke = 'rgba(71, 71, 71, 1)'
    e.target.style.strokeWidth = 0
  }
}

onUnmounted(() => {
  // window.removeEventListener('mouseover', onMouseOver)
  // window.removeEventListener('mouseleave', onMouseLeave)
})
</script>

